package JavaPractice;

import java.util.Scanner;

public class DataType_Variable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	   
      int n=10;
      for(int i=1;i<=10;i++)
      {
    	  for(int j=1;j<=n;j++)
    	  {
    		  System.out.print(i*j + " ");
    	  }
    	  System.out.println();
      }
      
        
     
	}

}
